import { useDispatch, useSelector } from "react-redux";
import { updateStudentFamilyDetailes } from "../dataManeger/DefiningActions";
import { useNavigate } from "react-router";

export const Login2 = () => {

    let dis = useDispatch()

    let navig = useNavigate()

    let currentProduct = useSelector(store=>store.currentUser)

    console.log("bhjghvjh")

    const send = (event) => {

        event.preventDefault();

        dis(updateStudentFamilyDetailes(currentProduct,{ nameFather: event.target[0].value, nameMother: event.target[1].value, amountChildren: event.target[2].value}))
        
        navig('/Login3')

    }

    return <>
        <form onSubmit={(e) => send(e)}>
            <label htmlFor={"nameFather"}>name father: </label>
            <input id="nameFather"></input>

            <label htmlFor={"nameMother"}>name mother: </label>
            <input id="nameMother"></input>

            <label htmlFor={"amountChildren"}>amount children: </label>
            <input id="amountChildren"></input>

            <input type={'submit'} value={'login'}></input><br></br>
        </form>

    </>
}
